export default [

    //HEMSTÄD
    //ALLA RUM

    {
        text: "Damma alla fria ytor"
    },
    {
        text: "Ta ut och skaka alla lösa mattor + dammsug"
    },
    {
        text: "Dammsug alla fasta mattor och under ytterkanten"
    },
    {
        text: "Dammsug och torka alla golv överallt där vi kommer åt. Under sängar, skåp, byråer mm"
    },
    {
        text: "Torka alla dörrar och dörrhantag och garderobsdörrar vid behov"
    },
    {
        text: "Töm papperskorgar"
    },
    {
        text: "Torka eluttag, lysknappar, lister, trösklar, fönsterbrädor, bänkytor, lampa"
    },

]
